import React from "react";
import "./App.css";

function GetGridSizeArea() {
  return <p>Taille de la grille : </p>;
}

function App() {
  return (
    <div className="App">
      <h1>MowGrass-IT</h1>
      <button type="button" class="btn btn-primary">
        Récupérer le sujet
      </button>
      <GetGridSizeArea />
    </div>
  );
}

export default App;
